<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Thanku-page</title>
    <style>
        body {
            margin: 0;
            font-size: 5em;
            background-image: url(png/bg.jpg);
        }

        .banner {
            height: 100vh;

            display: flex;
            justify-content: center;
            align-items: center;
            position: relative;
            overflow: hidden;
        }

        .banner::before {
            content: '';
            position: absolute;
            inset: 0;
            background-image: url('png/valentin-petrov-m-mal-01.jpg');
            background-size: cover;
            background-position: center;
            animation: bgZoomIn 4s ease-in-out 1 forwards;
            z-index: -1;
            pointer-events: none;
        }

        .banner::after {
            content: '';
            position: absolute;
            inset: 0;
            background-image: url('png/after.png');
            background-size: cover;
            background-position: top;
            transform: scale(2);
            animation: bgZoomOut 4s ease-in-out 1 forwards;
            z-index: -1;
            pointer-events: none;
        }

        @keyframes bgZoomIn {
            from {
                transform: scale(1.2);
            }

            to {
                transform: scale(1);
            }
        }

        @keyframes bgZoomOut {
            from {
                transform: scale(1);
            }

            to {
                transform: scale(2);
            }
        }

        svg path {
            fill: transparent;
            stroke: #fff;
            stroke-width: 0.5;
            stroke-dasharray: 50;
            stroke-dashoffset: 50;
            animation: textAnimation 4s ease-in-out 1 forwards;
        }

        @keyframes textAnimation {
            0% {
                stroke-dashoffset: 50;
            }

            80% {
                fill: transparent;
            }

            100% {
                fill: #fff;
                stroke-dashoffset: 0;
            }
        }
    </style>

</head>
